import React from 'react'

import FormUser from '../components/UserCreate/index'
import {Helmet} from 'react-helmet';



export default function  EditUser() {

    return (
        <>
            <Helmet>
                <title>Editar usuario</title>
            </Helmet>
            <div className="wrapper fadeInDown">
                <FormUser />
            </div>
        </>
    );
    
}
